import React, {
  useState,
  useEffect
} from "react";
import ReactDOM from "react-dom";
import "./index.css";

const [data, setData] = useState(null);

function AdData() {

  useEffect(() => {
   fetch(`https://jf-na-cdn.justfab.com/image/site/en_US/dm/acquisition/feed/justfab/topconvert/jsonTest.json`)

      .then(res => res.json())
      // .then(json => console.log(json))
      .then(setData)
      .catch(console.error);
  }, []);

  if (data) {
    return (

      <div>

      {data.map(
            adreport => <AdReport spend="" cpl={data.cpl} cac={data.cac}/>
      )}

      </div>
    );
  }
  return null;
}


const AdReport = ({spend, cpl, cac, adid}) => {
	return (
		<section>
  		<p>Spend: {data.spend}</p>
			<p>CPL: {cpl}</p>
			<p>CAC: {cac}</p>
		</section>
	)
}



function TopAdsPage() {
  return <AdData/>;
}

ReactDOM.render(
  <TopAdsPage/>,
  document.getElementById("root")
);
